import React, {useState} from 'react';
import Axios from'axios';
import '../App.css'
import Admin from '../components/adminDashboard';



function Doctors() {

    const [doctor_list, setDoctorList] = useState([])
    const [name, setName] = useState('')
    const [designation, setDesignation] = useState('')
    const [gender, setGender] = useState('')
    const [address, setAddress] = useState('')
    const [highest_qualification, setHighest_Qualification] = useState('')



    const getData = ()=>{
        Axios.get('http://localhost:3001/admin/doctors_list').then((res)=>{
            setDoctorList(res.data)
        })
    }


    getData();




    const Insert= (signin_id)=>{
        Axios.put('http://localhost:3001/admin/insert_doctors_list', {
            name: name,
            designation: designation,
            gender: gender,
            address: address,
            highest_qualification: highest_qualification,
            signin_id: signin_id
        })
        getData();
    }






    const Update= (signin_id)=>{
        Axios.put('http://localhost:3001/admin/update_doctors_list', {
            name: name,
            designation: designation,
            gender: gender,
            address: address,
            highest_qualification: highest_qualification,
            signin_id: signin_id
        })
        getData();
    }



    const Delete= (signin_id)=>{
        Axios.put('http://localhost:3001/admin/delete_doctor', {
            signin_id: signin_id
        })
        getData();
    }


    return(
        <div>
            <Admin/>

            <div className='doctors' style={{marginLeft: '100px', height:'20vh'}}>
                <h1>List of Doctors</h1>
            </div>  
            
            <table id = 'doctors' style={{alignItems: 'center', justifyContent: 'center', display: 'flex', 
                                            height:'40vh', marginLeft: '160px',borderCollapse: 'separate', 
                                            borderSpacing: '0 15px'}}>
            

            <tbody>
                {doctor_list.map((val, key)=>{
                    return(
                        <tr style={{boxShadow: '10px 10px 5px grey', backgroundColor: '#c4d8e2',
                                    border:'5px', borderSpacing: '0 15px', width: '150px', 
                                    textAlign:'center'}}>              
                        

                        <td>{val.name}</td>
                        <td>{val.designation}</td>
                        <td>{val.gender}</td>
                        <td>{val.address}</td>
                        <td>{val.highest_qualification}</td>

                        <td>
                            <div>
                                <button className='btn btn-primary btn-block' onClick={Update(val.signin_id)} style={{backgroundColor: '#0072c6', color: 'white'}}>Update</button>
                            </div>
                        </td>


                        <td>
                            <div>
                                <button className='btn btn-primary btn-block' onClick={Delete(val.signin_id)} style={{backgroundColor: '#0072c6', color: 'white'}}>Delete</button>
                            </div>
                        </td>
                        
                        </tr>

                    
                    )
                })}

            </tbody>

            </table>
    
        </div>
    


    )
}



export default Doctors;
